import React, { useState } from 'react'

export default function GraphPage() {
  const initialData = [
    {
        name: 'car',
        value: 10,
    },
    {
        name: 'bike',
        value: 20,
    },
    {
        name: 'truck',
        value: 30,
    },
    {
        name: 'bus',
        value: 25,
    },
    {
        name: 'train',
        value: 50,
    },
    {
        name: 'plane',
        value: 75,
    },
  ]

  const width = 500;
  const height = 150;
  const padding = 20;
  const maxValue = 100;

  const [chartdata, setChartData] = useState(initialData);


  return (
    <div>
        <svg id="chart" viewBox="0 0 500 150">
            <path d="" fill="none" stroke="white" strokeWidth="5" />
        </svg>
    </div>
  )
}
